import logo from './logo.svg';
import './App.css';
import bmi_logo from './bmi.png'

function App() {
  return (
    <div className="App">
      <img src={bmi_logo} alt="bmilogo" />
      <h2>BMI Calculator</h2>
      <label htmlFor="height">Height(cm):</label>
      <input type="text" id="height" name="height" className="textbox"/>
      <label htmlFor="weight">Weight(cm):</label>
      <input type="text" id="weight" name="weight" className="textbox"/>
      <button>Calculate BMI</button>
      <button>Clear</button>
      <div>
        <p>Yout BMI is: 26.00</p>
        <p>States: Overweight</p>
      </div>
    </div>
  );
}

export default App;
